const React = require('react');
const Default = require('./layouts/default');

function error404() {
  console.log('error page called');
  return (
    <Default>
      <h1>404 Error, please click on the button to return to bread selection</h1>
      <a href="/breads">Bread Selection</a>
    </Default>
  );
};

module.exports = error404;
